import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { CardBasic } from "../Components/CardBasic";
import { IstabasAttels } from "../Components/IstabasAttels";
import bottom from "../Restes_bildes/balts.png";
import bottom_g from "../Restes_bildes/zals.png";

import k1 from "../Restes_bildes/kreisa1.png";
import k2 from "../Restes_bildes/kreisa2.png";
import k3 from "../Restes_bildes/kreisa_istaois_3.png";
import k4 from "../Restes_bildes/kreisa3.png";
import k1g from "../Restes_bildes/3stavs/kreisa1g.png";
import k2g from "../Restes_bildes/3stavs/kreisa2g.png";
import k3g from "../Restes_bildes/3stavs/kreisa_istaois_3g.png";
import k4g from "../Restes_bildes/3stavs/kreisa3g.png";

import kl1 from "../Restes_bildes/kreisa_leja_2.png";
import kl2 from "../Restes_bildes/kreisa_leja_3.png";
import kl3 from "../Restes_bildes/kreisa_leja_4.png";
import kl4 from "../Restes_bildes/kreisa_leja_5.png";
import kl5 from "../Restes_bildes/3stavs/kreisa_leja_pedejais.png";
import kl6 from "../Restes_bildes/3stavs/kreisa_apaksa_small.png";

export const Floor = () => {
  const param = useParams();
  const { id } = param;
  useEffect(() => {
    // api call
    console.log("also i call something to python");
    console.log(id);
  }, [id]);

  const styleProps = {
    position: "absolute",
    transition: "all 0.25s",
  };
  return (
    <>
      <div style={{ textSizeAdjust: "2rem" }}>This is Floor {id} plan</div>
      <CardBasic>
        <IstabasAttels
          alt={"logo1"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 425,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo2"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 495,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo3"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 565,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo4"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 635,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo5"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 705,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo6"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 775,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo7"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 845,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo8"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 915,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo9"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 985,
            top: 300,
          }}
        />
        <IstabasAttels
          alt={"logo10"}
          source1={bottom}
          source2={bottom_g}
          styleProps={{
            ...styleProps,
            transform: "scale(0.7)",
            left: 1055,
            top: 300,
          }}
        />

        <IstabasAttels
          alt={"logo11"}
          source1={k1}
          source2={k1g}
          styleProps={{ ...styleProps, left: 645, top: 200 }}
        />
        <IstabasAttels
          alt={"logo12"}
          source1={k2}
          source2={k2g}
          styleProps={{ ...styleProps, left: 615, top: 200 }}
        />
        <IstabasAttels
          alt={"logo13"}
          source1={k3}
          source2={k3g}
          styleProps={{ ...styleProps, left: 542, top: 200 }}
        />
        <IstabasAttels
          alt={"logo14"}
          source1={k4}
          source2={k4g}
          styleProps={{ ...styleProps, left: 440, top: 200 }}
        />

        <img
          style={{
            position: "absolute",
            left: 378,
            top: 257,
            transform: "scale(1)",
          }}
          src={kl1}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo15"
        />
        <img
          style={{
            position: "absolute",
            left: 330,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl2}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo16"
        />
        <img
          style={{
            position: "absolute",
            left: 293,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl3}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo17"
        />
        <img
          style={{
            position: "absolute",
            left: 220,
            top: 262,
            transform: "scale(1)",
          }}
          src={kl4}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo18"
        />
        <img
          style={{
            position: "absolute",
            left: 156,
            top: 250,
            transform: "scale(1)",
          }}
          src={kl5}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo19"
        />
        <img
          style={{
            position: "absolute",
            left: 194,
            top: 250,
            transform: "scale(1)",
          }}
          src={kl6}
          onmouseover="hover(this);"
          onmouseout="unhover(this);"
          alt="Logo20"
        />
      </CardBasic>
    </>
  );
};
